import React from 'react';
import styled from 'styled-components';

import themes from "../../styles/themes"
import { connect } from "react-redux";
import {Div} from '../../styles/DefaultStyles';


const DivContainer = styled(Div)`

`;


const IconMinus = ({width, height, themeName}) => {

	return (

	<DivContainer style= {{ width: `${width}`, height:`${height}` }} >
		<svg 

			className="icon usingHover Info"
			xmlns="http://www.w3.org/2000/svg" 


			width="100%"
			height="100%"
			viewBox="0 0 348 512"

			fill={ themes[themeName]["color_weak"] }
			>

			<path 
	d="M368 224H16c-8.84 0-16 7.16-16 16v32c0 8.84 7.16 16 16 16h352c8.84 0 16-7.16 16-16v-32c0-8.84-7.16-16-16-16z">
			</path>

		</svg>
	</DivContainer>
	)
	}

function mapStateToProps(state) { 
  return { 
    themeName: state.themeName
  }; 
} 

/*
function mapDispatchToProps(dispatch) { 
  return { 
    readPlanTeam: (idPlanTeam) => dispatch(readPlanTeam(idPlanTeam)) 
  }; 
}
*/

export default connect(mapStateToProps)(IconMinus);
